import { CartTotal } from "./components/cart/CartTotal";
import { Categories } from "./components/categories/Categories";
import Header from "./components/header/Header";
import { Products } from "./components/products/Products";

function App() {
  return (
    <>
      <Header />
      <div className="home px-6 flex md:flex-row flex-col justify-between gap-10">
        <div className="categories overflow-auto max-h-[calc(100vh-_-112px)] md:pb-20 md:mr-0 -mr-[24px]">
          <Categories></Categories>
        </div>
        <div className="products flex-[8]">
          <Products/>
        </div>
        <div className="cart-wrapper min-w-[180px] md:-mr-[24px] md:-mt-[24px] border">
          <CartTotal/>
        </div>
      </div>
    </>
  );
}

export default App;
